import { useEffect, useState, useContext} from 'react';
import {useParams} from 'react-router-dom';
import StudentList from '../components/StudentList';

function Students() {
  const [students, setStudents] = useState([]);
  const {branchId} = useParams();
  console.log("branch",branchId);

    const fetchStudents=async(dispatch)=>{
        try{

              const response = await fetch(`http://localhost:5000/students/branch/${branchId}`);
              if (!response.ok) {
                throw new Error('Fetching Fabrics failed')
              }
              const {students} = await response.json();
              console.log(students);
              setStudents(students);
          }catch(error){
            console.log(error.message);
           }
        }

  useEffect(() => {
        fetchStudents();
    },[]);
    return (
    <>{students && <StudentList students={students} updateStudentList={fetchStudents}/>}</>);
  };

    export default Students;
